//Estilos
import { useState } from 'react'
import '../stylesheet/componentes/slide_images.css'

function Carousel ({url_imagen_1, url_imagen_2, url_imagen_3, url_imagen_4, url_imagen_5, url_imagen_6}) {


// aux = 0
// length_2 = len(array)

// first = 1
// second = 2
// last_one = length_2-1
// last_one_2 = length_2-2

    const [carousel, setCarousel] = useState([])
    const [aux, setAux] = useState(0)
    const [length_2,setLeng_2] = useState(0)
    const [first,setFirst] = useState(1)
    const [second,setSecond] = useState(2)

    setCarousel([url_imagen_1,url_imagen_2,url_imagen_3,url_imagen_4,url_imagen_5,url_imagen_6])
    setLeng_2(carousel.length)

    const [last_one,setLastOne] = useState(length_2-1)
    const [last_one_2,setLastOne2] = useState(length_2-2)

    const adelante = () => {

        // if (aux < carousel.length_2-1){ 
        //     setAux(aux+1)
        // }
        // else {
        //     setAux(0)
        // }
        // return aux

        // codigo marco

        setAux(aux + 1)

        if (aux === length_2 || aux === 0)
            {   
                setAux(0) 
                setFirst(aux +1)
                setSecond(aux +2)
                setLastOne(length_2 - 1)
                setLastOne2(length_2 - 2)
            }


        if( aux === 1)
            {
                setFirst(aux +1)
                setSecond(aux +2)
                setLastOne(aux - 1)
                setLastOne2(length_2 - 1)
            }



        if( aux === length_2-1)

            {
                setFirst(0)
                setSecond(1)
                setLastOne(aux -1)
                setLastOne2(aux - 2)
            }


        if( aux === length_2-2)

            {
                setFirst(length_2-1)
                setSecond(0)
                setLastOne(aux -1)
                setLastOne2(aux - 2)
            }

        else
            {
                setFirst(aux+1)
                setSecond(aux+2)
                setLastOne(aux -1)
                setLastOne2(aux - 2)
            }

        if (aux === length_2-1)

            {
                setAux(-1)
            }

        if( aux < 0)

            {
                setAux(length_2 - 1)
            }
            // codigo marco

        }


    const atras = () => {
        // if (aux > 0){
        //     setAux(aux-1)
        // }
        // else{
        //     setAux(carousel.length-1)
        // }
        // return aux

        // codigo marco


        setAux(aux - 1)

        if (aux === 0)

            {
                first(aux +1)
                second(aux +2)
                last_one(length_2 - 1)
                last_one_2(length_2 - 2)
            }

        if (aux === -1)

            {
                setFirst(aux +1)
                setSecond(aux +2)
                setLastOne(length_2 + aux - 1)
                setLastOne2(length_2 + aux - 2)
            }

        if (aux === -2)

            {
                setFirst(aux +2)
                setSecond(aux +3)
                setLastOne (length_2 + aux - 2)
                setLastOne2 (length_2 + aux - 3)
            }


        if (aux === 1)

            {
                setFirst(aux +1)
                setSecond(aux +2)
                setLastOne(aux - 1)
                setLastOne2(length_2 - 1)
            }

        if (aux === length_2-1)

            {
                setFirst(0)
                setSecond(1)
                setLastOne(aux -1)
                setLastOne2(aux - 2)
            }

        if (aux === length_2-2)

            {
                setFirst(length_2-1)
                setSecond(0)
                setLastOne(aux -1)
                setLastOne2(aux - 2)

            }

        else

            {
                setFirst(aux + 1)
                setSecond(aux + 2)
                setLastOne(aux -1)
                setLastOne2(aux - 2)
            }

        // codigo marco

        if (aux === length_2-1)

            {
                setAux(-1)
            }

        if( aux < 0)

            {
                setAux(length_2 - 1)
            }
            // codigo marco

    }



    return(
        <div className="slide_images">
            <button className="btn-back" onClick={adelante}>A</button>

            <div className="div_img_slide_1">
                <img className="slide_url_img" src={first} alt="imagen 1" /> 
            </div>
            <div className="div_img_slide_2">
                <img className="slide_url_img" src={second} alt="imagen 2" />
            </div>
            <div className="div_img_slide_3">
                <img className="slide_url_img" src={aux} alt="imagen 3" />
            </div>
            <div className="div_img_slide_2">
                <img className="slide_url_img" src={last_one} alt="imagen 4" />
            </div>
            <div className="div_img_slide_1">
                <img className="slide_url_img" src={last_one_2} alt="imagen 5" />
            </div>

            <button className="btn-back" onClick={atras}>B</button>
        </div>
    )
}                
export default Carousel
